import { Link } from "react-router-dom";
import './Header.css';
const Header = () => {
    return ( 
        <nav className="header">
            <Link to="/"><img src="img/logo" /></Link>
            <div className="links">
                <p>Home</p>
                <p>login</p>
                <p>registration</p>
            </div>
        </nav>
     );
}
 
export default Header;
